<!DOCTYPE html>
<html lang="en">
  <head>
    <title>Pixel Canvas</title>
    <style>
      h1 {
        font-family: "lucida grande";
        font-weight: 200;
        font-size: 70px;
        text-align: center;
      }
      .container {
        display: grid;
        width: 1500px;
        height: 720px;
        aspect-ratio: 1;
        grid-template-columns: repeat(150, 1fr);
        grid-template-rows: repeat(72, 1fr);
        box-shadow: 0 0 10px hsl(0, 0%, 30%);
        margin: auto;
      }

      .items {
        animation-duration: 1ms;
        animation-fill-mode: forwards;
        animation-name: paint;
        animation-play-state: paused;
        &:hover {
          animation-play-state: running;
        }
      }

      @keyframes paint {
        to {
          box-shadow: 10px 10px 15px black;
          background-color: black;
        }
      }
    </style>
  </head>
